import React from "react";
import { Link } from "react-router-dom";
import { Button } from "./Button";

export const LinkButton = ({ 
  path,
  onClick, 
  isDisabled, 
  ...props }) => {
  return (
    <Link to={path}>
      <Button disabled={isDisabled} {...props} onClick={onClick} />
    </Link>
  );
};
